INSERT INTO `pvr_programas` VALUES (94,3,4,74,30,NULL,0,0,'00:02:02:6b:d1:a8','EP034664130001','The Story of Late Night','Inventing Late Night TV','At the dawn of the TV era in the 1950s, Steve Allen\'s zany spontaneity turns /Tonight/ into a hilarious and unexpected hit; in the early 1960s, it\'s Jack Paar\'s captivating, quirky personality and Johnny Carson\'s impeccably hip humor.','','Unknown channel','20210515','21:00','22:00','1621137600','1621141200','igmp://225.1.1.6:2000'),(129,3,4,65,46,NULL,0,0,'00:02:02:6b:d1:a8','EP034664130003','The Story of Late Night','Eyes on the Throne','As the 1980s dawn, David Letterman reinvents late night comedy for a new generation, rescuing comedian Jay Leno\'s nearly flamed-out career in the process. But Johnny Carson\'s enduring comic appeal spawns speculation over his eventual successor.','','Unknown channel','20210522','19:00','20:00','1621735200','1621738800','igmp://225.1.1.6:2000'),(130,3,4,66,47,NULL,0,0,'00:02:02:6b:d1:a8','EP034664130002','The Story of Late Night','Carson: King of Late Night','Johnny Carson deftly navigates the turbulent 1960s to elevate /The Tonight Show/ into a cultural touchstone, enshrining himself as the undisputed king of late night; his success begets competition with the emergence of Dick Cavett, Merv Griffin.','','Unknown channel','20210522','20:00','21:00','1621738800','1621742400','igmp://225.1.1.6:2000'),(141,4,4,0,141,NULL,0,0,'00:03:e6:eb:98:90','EP014160490331','Impractical Jokers','Sun-Fan Lotion','Joe, Murr, Q, and Sal are at the massage parlor for much /kneaded/ relaxation; they ask strangers their opinions on questionable yearbook ads; the big loser has an awkward but /fan-tastic/ time in the sun.','','Unknown channel','20210524','18:04','18:30','1621904680','1621906200','igmp://225.1.1.13:2000'),(142,3,4,77,56,NULL,0,0,'00:02:02:6b:d1:a8','EP034664130004','The Story of Late Night','Letterman vs. Leno','Carson\'s 1992 retirement touches a nation and sets off an epic late-night war