g Break with friends after cramming for medical exams; Brian is clearly recorded on surveillance video entering a bar, but is mysteriously never seen leaving.','','102 - HLN','20220901','12:00','13:00','1662055200','1662058800','igmp://225.1.1.3:2000'),(5266,72,3,43,0,NULL,0,0,'00:02:02:6b:d0:7c','EP033376060005','Real Life Nightmare','Deadly Hotel Check-In','College student Elisa Lam checks into a Los Angeles hotel but never checks out; the last known images of the young tourist are from the hotel\'s elevator security camera; nearly 2 weeks later, her naked body is found in the hotel\'s rooftop water tank.','','102 - HLN','20220901','13:00','14:00','1662058800','1662062400','igmp://225.1.1.3:2000'),(5267,23,3,54,0,NULL,0,0,'00:02:02:6b:92:82','SH032745260000','College Football 150: The American Game','','This documentary series is a definitive look at the history of college football as both a sport and a cultural phenomenon.','','503 - ESPNU','20220901','17:00','18:00','1662073200','1662076800','igmp://225.1.1.45:2000'),(5268,72,3,44,0,NULL,0,0,'00:02:02:6b:d0:7c','EP033376060018','Real Life Nightmare','Jennifer Dulos: Connecticut Murder Mystery','A mom of five disappears after dropping her kids at school, but evidence shows a brutal assault in the garage of her upscale, Connecticut home.','','102 - HLN','20220901','14:00','15:00','1662062400','1662066000','igmp://225.1.1.3:2000'),(5269,72,3,45,0,NULL,0,0,'00:02:02:6b:d0:7c','EP033376060001','Real Life Nightmare','5-Year-Old Vanished','5-year-old Haleigh Cummings disappears from her home after her dad\'s girlfriend puts her to bed.','','102 - HLN','20220901','15:00','16:00','1662066000','1662069600','igmp://225.1.1.3:2000');
