INSERT INTO `vod_peliculas` VALUES (1,'1917','At the height of the First World War, two young British soldiers, Schofield (Captain Fantastic\'s George MacKay) and Blake (Game of Thrones\' Dean-Charles Chapman) are given a seemingly impossible mission. In a race against time, they must cross enemy territory and deliver a message that will stop a deadly attack on hundreds of soldiers--Blake\'s own brother among them. ',2019,'8.3','R',119,'1h 59min','1917.jpg','1917_en.mkv','M00001'),(2,'A hidden life','Based on real events, A HIDDEN LIFE is the story of an unsung hero, Franz Jagerstatter, who refused to fight for the Nazis in World War II. When the Austrian peasant farmer is faced with the threat of execution for treason, it is his unwavering faith and his love for his wife Fanni and children that keeps his spirit alive. ',2019,'7.4','PG-13',174,'2h 54min','AHiddenLife.jpg','A_Hidden_Life.m4v','M00002'),(3,'The Lighthouse','From Robert Eggers, the visionary filmmaker behind modern horror masterpiece The Witch, comes this hypnotic and hallucinatory tale of two lighthouse keepers on a remote and mysterious New England island in the 1890s.',2019,'7.6','R',109,'1h 49min','TheLighthouse.jpg','The_Lighthouse.m4v','M00003'),(4,'Little women','Jo March reflects back and forth on her life, telling the beloved story of the March sisters - four young women, each determined to live life on her own terms.',2019,'7.9','PG',135,'2h 15min','LittleWomen.jpg','Little_Women.m4v','M00004'),(5,'Judy','Winter 1968 and showbiz legend Judy Garland arrives in Swinging London to perform a five-week sold-out run at The Talk of the Town. It is 30 years since she shot to global stardom in The Wizard of Oz, but if her voice has weakened, its dramatic intensity has only grown. As she prepares for the show, battles with management, charms musicians and reminisces with friends and adoring fans, her wit and warmth shine through. Even her dreams of love seem undimmed as she embarks on a whirlwind romance with Mickey Deans, her soon-to-be fifth husband.',2019,'6.8','PG-13',118,'1h 58min','Judy.jpg','Judy.m4v','M00005'),(6,'Melancholia','Two sisters find their already strained relationship challenged as a mysterious new planet threatens to collide with Earth. ',2011,'7.2','B15',135,'2h 15min','Melancholia.jpg','Melancholia.m4v','M00006'),(7,'Late night','Legendary late-night talk show host\'s world is turned upside down when she hires her only female staff writer. Originally intended to smooth over diversity concerns, her decision has unexpectedly hilarious consequences as the two women separated by culture and generation are united by their love of a biting punchline. ',2019,'6.5','R',102,'1h 42min','LateNight.jpg','LateNight.m4v','M00007'),(8,'Jumanji: The Next Level','In Jumanji: The Next Level, the gang is back but the game has changed. As they return to rescue one of their own, the players will have to brave parts unknown from arid deserts to snowy mountains, to escape the world\'s most dangerous game. ',2019,'6.7','PG-13',123,'2h 3min','JumanjiN.jpg','Jumanji_Next.m4v','M00008');
